MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "Verification Management is a set of functionality within Questa SIM which offers a wide variety of features for managing your test environment. ");
MGCAddSnippet(6, "This manual is intended to guide users through the process of using the various Verification Management tasks within the Questa SIM tool. It is assumed that you already have a basic understanding of, as well as some experience with, the generation of a UCDB, and merging UCDBs. ");
MGCAddSnippet(7, "Once a verification plan is established, you can analyze the fulfillment of your verification requirements and measure your overall verification progress against the verification plan. ");
MGCAddSnippet(8, "You can use one of several modes when accessing the Verification Management tools, depending on the level of interaction you desire with the UCDB that stores the verification data. The UCDB database itself is stored in a persistent form in a binary file. ");
MGCAddSnippet(9, "To use some of the Questa SIM verification plan and tracking features, it is necessary to have a basic understanding of the XML markup language. This section is provided for those who have little or no experience with XML.");
MGCAddSnippet(10, "The key component in any verification management endeavor is a verification plan, also known as a testplan. This section describes the content and structure, as well as the syntax of the elements of that plan. ");
MGCAddSnippet(11, "At the heart of verification management is the verification plan, written in an editing tool and converted into a UCDB file.");
MGCAddSnippet(12, "This section defines and describes the information required in a typical Verification Plan in order to enable many of the powerful capabilities within the Verification Management tool. ");
MGCAddSnippet(13, "The fields (or columns, in the case of a spreadsheet) of data in a testplan are determined positionally. In other words, for an import to work correctly, the fields to be imported must appear in their default (expected) positions in the plan. ");
MGCAddSnippet(14, "The fields /columns of data in the Verification Plan represent the pre-defined and expected standard attributes within the UCDB. In addition to these attributes, you can add your own data to include for later analysis. For example, you might want to add the name of the person responsible for a particular section of the plan, or the priority level for a section of the testplan. ");
MGCAddSnippet(15, "One of the most important aspects of the Verification Plan is the definition of the links to the coverage objects within the environment. Any coverage object within the UCDB can be linked to the testplan. The UCDB has a tagging mechanism that allows testplan scopes and coverage scopes within the database to be tagged. If a testplan scope and a coverage scope share the same tag, which is a string, then they are associated. This allows coverage to be calculated and queried based upon the testplan. The xml2ucdb utility transforms information within the link, type and path values into  coverage tag  syntax, which is then stored as an attribute of the testplan scope. The format used within the link, type and path values is the same regardless of the document format used.");
MGCAddSnippet(16, "You can override at_least values for specific items in your testplan by placing the overriding value into the AtLeast column in the plan UCDB. Whether or not you need to create that column in which to put the overriding value depends on the format in which you write the original UCDB:");
MGCAddSnippet(17, "Two programs are available which greatly assist in the creation and editing of testplans. One is an OpenOffice Extension for Testplans, or an Excel Add-In for Testplans.");
MGCAddSnippet(18, "Coverage calculations algorithms for testplans and testplan sections, as well as the topics relevant to them are described in this section. ");
MGCAddSnippet(19, "The effective weight of a testplan item is the weight of a testplan scope or a linked coverage item that is used in the coverage calculation of a testplan. By default the effective weight of an item is the same as the actual weight of that item. ");
MGCAddSnippet(20, "The effective weight of a testplan scope or item depends on whether you are using the default weighting method or the autoweighting method (which you enable by using the xml2ucdb -autoweight argument). ");
MGCAddSnippet(21, "The weight of each testplan section is used to compute the coverage of the parent testplan section according to the  weighted average  method — regardless of whether that section s weight is determined by the default method or autoweighting. The weighted average method is the default setting for testplan coverage calculation, wherein the coverage grading calculation for a testplan as a whole is the weighted average of its children. This allows portions of the plan to be given more weight than others. ");
MGCAddSnippet(22, "The coverage of a testplan scope is calculated by taking the weighted average of all child testplan scopes using the effective weight of each item. If a testplan scope contains child testplans with coverage links, then the cumulative coverage of all the linked items is calculated first by taking the weighted average using the effective weights of those linked items. That cumulative coverage is then used with either a weight of 1 (default) or a weight equal to the total number of bins of those linked items (using autoweight), along with the coverage of child testplans to determine the weighted average for calculating the coverage of the parent testplan.");
MGCAddSnippet(23, "Empty testplan sections trigger an additional algorithm for coverage calculation. The following calculations apply: ");
MGCAddSnippet(24, "A UCDB file may contain two different type of hierarchies: ");
MGCAddSnippet(25, "This section contains a set of guidelines for writing verification plans to ensure that the Verification Plan Import utility properly recognizes the data in your plan. ");
MGCAddSnippet(26, "You can re-use instance-based testplans. This method of reuse — parameterized testplans — is most useful when dealing with IP, VIP, or for re-use within projects. Parameters can be applied within the testplan source and the values for these can be over-ridden for different uses of the IP, for example testplans for the Mentor Graphics VIPs or Questa Verification IP. ");
MGCAddSnippet(27, "Because the columns of data in an Excel-based imported testplan are determined positionally, all columns of data must appear in their default (expected) positions in the plan. ");
MGCAddSnippet(28, "Microsoft Word supports hierarchical sections using the  Heading  styles. ");
MGCAddSnippet(29, "DocBook is an open documentation format, based on XML. DocBook documents can be created and maintained using any number of specialized XML editors (like XmlMind's XXE or SyncRO Soft's Oxygen) and the format is simple enough to be edited with a standard text editor. DocBook, like Microsoft Word, supports a hierarchical document structure. ");
MGCAddSnippet(30, "The following table lists the paragraph labels that are automatically recognized in Microsoft Word (and DocBook) by the importer. ");
MGCAddSnippet(31, "The information in this section is provided as an alternative method for customizing testplan import.");
MGCAddSnippet(32, "You can use Microsoft Excel, Microsoft Word, or DocBook to export a plan. ");
MGCAddSnippet(33, "Because DocBook uses XML as its native format, it is not necessary to  export  the document to XML — simply import the document as-is.");
MGCAddSnippet(34, "Once you have exported the verification plan into XML, you need to import the XML formatted file into UCDB for the purposes of merging the plan with your test data.");
MGCAddSnippet(35, "Questa SIM allows you to import your formal verification plan, documented in the following formats, into the UCDB:");
MGCAddSnippet(36, "From the command prompt, enter the xml2ucdb command and arguments to specify XML input file, the UCDB output file and other parameters for the conversion.");
MGCAddSnippet(37, "You can import a verification plan from the GUI:");
MGCAddSnippet(38, "A verification plan can contain hierarchy, whereby other testplans are  nested  within a top level verification plan. The numbering of sections within a hierarchical plan is handled as if the contents of the  child  file were pasted into the  parent  plan section. The instructions for handling section numbering depend on whether the plans being imported are autonumbered (as in Word) or non-autonumbered (spreadsheet):");
MGCAddSnippet(39, "Each attribute corresponds to a column with the same name in your verification plan. ");
MGCAddSnippet(40, "The xml2ucdb.ini configuration file, as shipped with the tool, is sufficient for the vast majority of all imports. Generally, you should not need to modify this file to import a verification plan if the verification plan (top level testplan) was created as follows:");
MGCAddSnippet(41, "You may want the coverage from certain items in a testplan to be excluded from counting toward the calculations. Several methods exist for excluding information that exists in a testplan from the UCDB, depending on what you want to exclude. ");
MGCAddSnippet(42, "During the process of developing a testplan, you may not want to register a low coverage score, such as when you have unimplemented testplan sections. ");
MGCAddSnippet(43, "Several methods exist for excluding individual coverage items, or excluding a subsection of items. ");
MGCAddSnippet(44, "To exclude a testplan section, set the value of the Weight column for that section to 0 within the overall testplan. ");
MGCAddSnippet(45, "It is possible to exclude portions of the source XML of the plan from being processed by using the  excludetags  parameter. This is a useful feature when you have control over the XML file format itself; for example, you can add or identify XML tag names within the source XML file that you want xml2ucdb to skip processing. This is more likely to be useful in a word processing type document where the application allows different formats to be added and they can then be identified in the XML source document at XML tags.");
MGCAddSnippet(46, "A hierarchical (or nested) testplan is a testplan which is imported within an overall testplan UCDB file. Only one UCDB (containing the nested testplan) is generated per importation. The parent plan may be referred to as a  hierarchical  plan.");
MGCAddSnippet(47, "Section numbering is handled as if the contents of the  child  file were pasted into the  parent  testplan section. The following rules and limitations apply when mixing autonumbered and non-autonumbered plans.");
MGCAddSnippet(48, "Following is an example of a nested verification plan. ");
MGCAddSnippet(49, "You can specify that a nested testplan inherit a parent s storing state (resulting from start/stop tags or startstoring tag) using the -inherit argument to the xml2ucdb command. ");
MGCAddSnippet(50, "Once you have captured your verification plan, the testplan and the test data must be combined in order to assess where you stand relative to your verification goals. This is achieved through the links between the sections of the verification plan and specific coverage items in the design, which is where the real power behind importing your verification plan to UCDB lies. The links are forged automatically when you merge your verification plan (top level testplan) with the coverage test data in UCDBs, taken from your test runs. ");
MGCAddSnippet(51, "Linking allows you to verify, via the testplan, that coverage items are being covered. ");
MGCAddSnippet(52, "Various constructs exist within a design, to which a testplan section can be linked. These construct types are placed in the  Type  field within the verification plan. ");
MGCAddSnippet(53, "Information regarding the links themselves, and the rules governing them are as follows.");
MGCAddSnippet(54, "The links are performed automatically when you merge an imported testplan with actual tests you have run. Key to this linking, however, is the correct association of the design constructs — various linkable constructs in the design — to the verification plan items.");
MGCAddSnippet(55, "For spreadsheets, while it is legal to have multiple items listed on a single line, separated by whitespace or a semicolon (;), it is recommended that within each section s Link entry, you list only one coverage item per line. Each line can contain a coverage item of a different type: simply match each cover item in the Link field with the correct type in the Type field. ");
MGCAddSnippet(56, "The rules for links between testplan sections and the design vary slightly depending on the design construct involved. Specifically, correct linking relies on your testplan containing the specific datafields relating to the columns in the verification plan. These datafields — defined in the xml2ucdb.ini configuration file — are used during import to correctly map the XML version of your verification plan to a UCDB format. ");
MGCAddSnippet(57, "To specify the level of hierarchy for the design item you are linking, you can either:");
MGCAddSnippet(58, "During the process of developing a testplan, you may determine that some of your testplan sections have linked coverage objects which are not yet implemented (still under construction, or otherwise missing). ");
MGCAddSnippet(59, "To ensure that your coverage count correctly accounts for incomplete or unimplemented coverage item(s) within a testplan, you can use one of two methods. Each method has certain advantages.");
MGCAddSnippet(60, "Sometimes, you may not want to get a low testplan coverage score when you have unimplemented testplan sections. When this is the case, you can apply a weight of zero to such sections within the testplan. You can also use a weight of zero in any linked-to coverage items. Such zero-weighted coverage items will roll up into the testplan coverage score, causing their value to be excluded.");
MGCAddSnippet(61, "You may wish to link your coverage items to verification plan data within the code itself, as opposed to linking your coverage through entries in the plan. ");
MGCAddSnippet(62, "The following items may be linked in this manner.");
MGCAddSnippet(63, "The basic attribute syntax involves two specially purposed identifiers:  tplanref  and  tplansection. ");
MGCAddSnippet(64, "Specification of a tplanref in a module declaration links the aggregated design unit coverage for all forms of coverage found within the design unit. This is the equivalent of linking the design unit node in the UCDB with the testplan section.");
MGCAddSnippet(65, "There is an additional syntax for links from a covergroup instance or a coverpoint or cross of a covergroup instance. Without this syntax, the link from a covergroup is considered to be for the type as a whole, and the covergroup type coverage will appear with the verification plan. ");
MGCAddSnippet(66, "There is no way to link specific FSMs, toggles, or other individual code coverage UCDB nodes with SystemVerilog attributes. This is a limitation compared to forward linking.");
MGCAddSnippet(67, "To verify that the coverage of your verification plan and design items are covered as you expect, it is helpful to know what items in your verification plan are not associated with any item in the design database, and vice versa. Analysis of your test traceability relies on links between some aspect of coverage and sections of a testplan. ");
MGCAddSnippet(68, "When you discover that you have an unlinked coverage item you want to link to the testplan, use the XML Import Hint to determine the exact path and name, as well as the type of that item. You can then copy this information directly to your verification plan. ");
MGCAddSnippet(69, "The  coverage tag  command can be used to explore design hierarchy by simply omitting the  ‑tagname  argument. Used in this way, it displays the tags (links) in a concise manner that shows the hierarchy of the design, which you would need in order to debug linking errors. With some knowledge of the designer s intent and the  coverage tag  command as a debug aid, you can figure out the intent for matching. You can then construct a particular set of entries in your testplan document to generate the corresponding tag command.");
MGCAddSnippet(70, "Any coverage object within the UCDB can be linked to the testplan. ");
MGCAddSnippet(71, "The format used within the link, type and path values is the same — regardless of the document format used. In general, the following syntax for matching applies for all coverage types:");
MGCAddSnippet(72, "The  Tag  type allows you to link any coverage item that can be tagged with the coverage tag command.");
MGCAddSnippet(73, "Functional coverage includes SystemVerilog covergroups, coverpoints and crosses, or bins; SystemVerilog  cover  statements; and PSL cover directives. This can also include SystemVerilog and PSL assertions. A link between the testplan and the functional coverage object is created by the name of the object within the source code. To make a link straightforward, you should ensure that the object to which something is being linked has a unique name within the environment. This is not always a straightforward task, so there are a number of mechanisms within the link format to provide greater flexibility. ");
MGCAddSnippet(74, "You can define a linked item as a covergroup, a coverpoint, or a cross of a covergroup, and cause the coverage calculated for the complete covergroup, coverpoint or cross to be linked. These links can be defined in a number of ways which help ensure that each is unique.");
MGCAddSnippet(75, "Items specified are linked to the full hierarchical path of the assertion, formal property of assertion, cover directive or other coverage item in the design. For any of these links to be formed, the following testplan entries must exist:");
MGCAddSnippet(76, "You can link a plan item with any coverage metric that is stored within the UCDB, including code coverage. Examples of possible links include: ");
MGCAddSnippet(77, "Bin links are useful, though some information is required in order to make use of them.");
MGCAddSnippet(78, "The full path to a bin can be attained most easily using the -bins switch with the coverage tag command. In order to run the coverage tag command, you must first:");
MGCAddSnippet(79, "A bin is either considered covered or not covered. This is based on the LRM definition of  at least  as the value at which the bin moves from being uncovered to covered. Linking to a bin can only report a bin as either 0% or 100% covered, which yields little useful information. It's more useful to link to covergroups and crosses/coverpoints, as they can have coverage values anywhere between 0% and 100%, depending on the number of coverpoints and crosses or the number of bins covered, respectively. ");
MGCAddSnippet(80, "The strings you enter into the testplan for these items define either an instance name as a path or a design unit as a name as the link. ");
MGCAddSnippet(81, "When the string  Test  is specified in the Type column/field, it allows a testname to be defined and linked to within the UCDB. It is also what allows the successful running of a directed test to be linked to the testplan. The successful running of the test case is defined by the  teststatus  attribute set in the UCDB for the particular  testname . The value of the  teststatus  attribute is controlled automatically by the status of the simulation run. However, it can be overwritten with the CLI, based on any user defined function. ");
MGCAddSnippet(82, "If a class based approach is taken to the environment, for example when using UVM,OVM or Mentor's Advanced Verification Methodology (AVM), it is still possible to pass instance names. In this case the Covergroup is defined in a class within a package, the hierarchical location needs to start from the package where the class definition is defined. The same rules for connection of the links should be followed as shown with the following example.");
MGCAddSnippet(83, "The  XML  type is used for nested testplan import. The  Link  field would be a partial command line (essentially, the command line for the nested import without the  xml2ucdb  or the UCDB file name). During import, the nested testplan sections are inserted into the section where the  XML  type is used. ");
MGCAddSnippet(84, "Rules-based linking allows you to specify tracking requirements within your testplan, and link those requirements to scopes within the testplan. You can then view these requirements in the Tracker window and HTML reports.");
MGCAddSnippet(85, "A rule is a syntax for specifying a user requirement. A rule produces either a coverage bin object or a coverage scope object in the UCDB, which is linked with a testplan scope and displayed like any other coverage object. ");
MGCAddSnippet(86, "In order to use Rules, you must:");
MGCAddSnippet(87, "A rule is evaluated by the merge process after merging all the input files. At that point, the rule is said to be either bin-type or scope-type, depending on whether the rule is evaluated either to a boolean (true/false) value or to a coverage number. ");
MGCAddSnippet(88, "The syntax of a rule is the name of the rule followed by the required number of arguments separated by a colon, ':'.");
MGCAddSnippet(89, "During merge, covergroup bins are created for bin-type rules and generic scopes are created for scope-type rules. A virtual covergroup scope called  UserRules  is created under the  #TestplanGenericCoverage#  package for the purpose of holding all the bins created for different bin-type rules. A coverpoint is created for each rule type, and the name of the coverpoint is the rule name. Covergroup bins are created for each instance of a rule under the coverpoint created for the corresponding rule type. The name of a bin is constructed by concatenating the rule arguments.");
MGCAddSnippet(90, "This section lists the currently supported rules.");
MGCAddSnippet(91, "This rule is for checking test attribute values. It performs two different kinds of checks, depending on which of the possible two arguments (SPECIFIC_TESTS or IN_NUM_TESTS) is used.");
MGCAddSnippet(92, "This rule is for checking global attribute values. It creates a scope type rule if the OP is either PERCENTOF or ENUMERATE, otherwise it creates a bin type rule.");
MGCAddSnippet(93, "This rule is for checking user attribute values. It creates a scope type rule if the OP is either PERCENTOF or ENUMERATE, otherwise it creates a bin type rule. It operates the same as GLOBAL_ATTRIBUTE except for the object path required to specify the object of interest.");
MGCAddSnippet(94, "This bin-type rule is for checking whether the specified object is covered by the number of tests as specified by the num_tests and the operator argument. ");
MGCAddSnippet(95, "This bin-type rule is for checking coverage numbers of design units and instance scopes. It has multiple arguments to track different type of coverage numbers:");
MGCAddSnippet(96, "This rule is for checking formal attributes, formal proofs and formal assumptions, in specific or numbered tests. ");
MGCAddSnippet(97, "This section describes the XML format of some common documentation tools. It also details the specific settings required to capture the data from XML files generated by that specific tool. ");
MGCAddSnippet(98, "This section contains an example excerpt from a verification plan written in Microsoft Word and exported in XML format.");
MGCAddSnippet(99, "There are two main windows for analyzing verification management results in the GUI:");
MGCAddSnippet(100, "The Questa Testplan Creation OpenOffice/LibreOffice Calc extension aids Questa LinuxLinux is a registered trademark of Linus Torvalds in the U.S. and other countries./Unix users in the creation of testplans for Questa Verification Management by assisting with the creation and capture of the testplan spreadsheet, which is then used as the front-end to Questa s testplan tracking tool. ");
MGCAddSnippet(101, "The installation package, QuestaOOCalcAddOn_x86_64.zip, can be found in the <install_dir>/vm_src directory for both Unix and Windows versions of Questa.");
MGCAddSnippet(102, "If you want to disable the extension within OpenOffice/LibreOffice, without removing the installation, follow the instructions in this section. ");
MGCAddSnippet(103, "If your Questa extension has been disabled by OpenOffice/LibreOffice, you can re-enable it. ");
MGCAddSnippet(104, "The Questa OpenOffice/LibreOffice Calc extension is split into two sets of functionality: one set is accessed through the Questa VM menu, the other set through the Questa Toolbar.");
MGCAddSnippet(105, "The functions that can be run from the Questa VM menu are detailed in this section.");
MGCAddSnippet(106, "The Questa toolbar has seven buttons and can be opened by selecting the Questa tab in the OpenOffice/LibreOffice Calc ribbon. ");
MGCAddSnippet(107, "Use the Questa Addon Settings dialog box to control the type of validation and the types of coverage to be imported from the UCDB. Once selected, the settings are remembered by the extension.");
MGCAddSnippet(108, "This section can be used as a quick start guide to using the plug-in; it assumes that the extension has already been installed. ");
MGCAddSnippet(109, "The flow for creating a new testplan from scratch is as follows.");
MGCAddSnippet(110, "It is possible to have a testplan spreadsheet generated from a UCDB file which already contains testplan information. This could be a UCDB file that has been generated from another testplan via xml2ucdb, therefore could have come from another spreadsheet format, a word document or any other document format. ");
MGCAddSnippet(111, "As long as an existing spreadsheet follows a similar format to the format supported within Questa, the extension functions should work without having to re-format the spreadsheet. ");
MGCAddSnippet(112, "Managing links is a central component of a testplan management.");
MGCAddSnippet(113, "When you use the Add Link data entry dialog within the toolbar — to help with the linking to the coverage objects — an association is made with a UCDB file automatically. Once this association has been made, the extension generates cache link files from the UCDB and stores them in a tmp directory named: ");
MGCAddSnippet(114, "Links can be added to the plan from the OpenOffice add-in.");
MGCAddSnippet(115, "If a currently active spreadsheet is already associated to a particular testplan other than the one you want to create links to, you must first remove that association (link) before you can select another UCDB for linking. ");
MGCAddSnippet(116, "You can save and export in both XML and UCDB formats. ");
MGCAddSnippet(117, "Choosing Save/Export Testplan > to XML from the main menu exports an XML file that can import the testplan into Questa using the xml2ucdb program. ");
MGCAddSnippet(118, "By choosing Save/Export Testplan > to UCDB from the main menu selection, you not only export an XML file, but you also generate a script to run the xml2ucdb executable and then run that xml2ucdb executable to produce a UCDB with the testplan imported. ");
MGCAddSnippet(119, "A number of syntax or format problems can occur during the development of a testplan in the spreadsheet. These problems are normally found during the use of the xml2ucdb process, with errors and warnings printed as part of the process. ");
MGCAddSnippet(120, "The Questa Testplan Tracking Excel Add-In aids Questa Windows users in the creation of testplans for Questa Verification Management by assisting with the creation and capture of the testplan spreadsheet. The spreadsheet is then used as the front-end to Questa s testplan tracking tool. ");
MGCAddSnippet(121, "This section contains the directions for installation.");
MGCAddSnippet(122, "If you want to disable the Add-In within Excel, without removing the installation, follow the instructions in this section. ");
MGCAddSnippet(123, "If your Questa Add-In has been disabled by Excel, you can re-enable using the following instructions. ");
MGCAddSnippet(124, "The Questa Excel Add-In is split into two sets of functionality: one set is accessed through the Questa VM menu, the other set through the Questa Toolbar.");
MGCAddSnippet(125, "The functions that can be run from the Questa VM menu are detailed in this section.");
MGCAddSnippet(126, "The Questa toolbar has buttons which can be selected to access functionality of the AddIn. The toolbar can be opened by selecting the Questa tab in the Excel ribbon. ");
MGCAddSnippet(127, "The Settings dialog box controls the type of validation and the types of coverage to be imported from the UCDB. Once selected, the settings are remembered by the Add-In.");
MGCAddSnippet(128, "This section can be used as a quick start guide to using the plug-in; it assumes that the Add-In has already been installed. ");
MGCAddSnippet(129, "The flow for creating a new testplan from scratch is as follows:");
MGCAddSnippet(130, "It is possible to have a testplan spreadsheet generated from a UCDB file which already contains testplan information. This could be a UCDB file that has been generated from another testplan via xml2ucdb, therefore could have come from another spreadsheet format, a word document or any other document format. ");
MGCAddSnippet(131, "As long as an existing spreadsheet follows a similar format to the format supported within Questa, the Add-In functions should work without having to re-format the spreadsheet. ");
MGCAddSnippet(132, "Managing links is a central component of a testplan management.");
MGCAddSnippet(133, "When you use the Add Link data entry dialog within the toolbar — to help with the linking to the coverage objects — an association is made with a UCDB file automatically. Once this association has been made, the Add-In generates cache link files from the UCDB and stores them in a tmp directory named: ");
MGCAddSnippet(134, "Links can be added to the plan from the Excel add-in.");
MGCAddSnippet(135, "If a currently active spreadsheet is already associated to a particular testplan other than the one you want to create links to, you must first remove that association (link) before you can select another UCDB for linking. ");
MGCAddSnippet(136, "You can save and export in both XML and UCDB formats. ");
MGCAddSnippet(137, "Choosing Save/Export Testplan > to XML from the main menu exports an XML file that imports the testplan into Questa using the xml2ucdb program. The XML is output in a format that can be processed using the Excel format default in the xml2ucdb.ini of the Questa SIM product installation. ");
MGCAddSnippet(138, "The Save/Export Testplan > to UCDB menu selection not only exports an XML file, but it also generates a script to run the xml2ucdb executable and then runs the xml2ucdb executable to produce a UCDB with the testplan imported. ");
MGCAddSnippet(139, "A number of syntax or format problems can occur during the development of a testplan in the spreadsheet. These problems are normally found during the use of the xml2ucdb process, with errors and warnings printed as part of the process. ");
MGCAddSnippet(140, "The Verification Run Manager (VRM) accelerates the verification process through the use of automation and an understanding of the typical verification process. ");
MGCAddSnippet(141, "In a coverage driven verification methodology, when a new IP for a SoC or FPGA design is being developed, the verification team starts the verification process by creating a plan. ");
MGCAddSnippet(142, "The RMDB is  the brain  of the regression management. Contained in this section is a template/ example, as well as a more complete example, which contains a working version of a RMDB.");
MGCAddSnippet(143, "This chapter assumes a basic knowledge and understanding of the Unified Coverage DataBase (UCDB) and the test data stored there. It does not contain this information, except as it relates to a verification plan. ");
MGCAddSnippet(144, "In order to track test data, the files containing the data should be merged with the tesplan UCDB.");
MGCAddSnippet(145, "Test data related to the status of the verification of your design, including the coverage calculations, can be seen in the Tracker window.");
MGCAddSnippet(146, "Test data, including the coverage calculations, is perhaps best viewed in the Tracker window.");
MGCAddSnippet(147, "UCDB files from previously saved simulations are only viewable in Coverage View mode (post-processing). ");
MGCAddSnippet(148, "You can change the values for Goal, Weight and any user defined attributes in a .ucdb file by editing the values inside the Tracker window. ");
MGCAddSnippet(149, "The coverage analyze CLI command can be very useful in querying the complete UCDB. Queries can be based not only on the plan, but also on the design/testbench itself.");
MGCAddSnippet(150, "If you previously opened up a database in the Verification Tracker window, and you need to make a change to the associated verification plan, a shortcut is available to refresh the data shown in the Tracker.");
MGCAddSnippet(151, "You can add your own attributes to a specified test record.");
MGCAddSnippet(152, "You can use filtering in the Tracker window to trace verification requirements. ");
MGCAddSnippet(153, "For example you can filter for testplan sections or linked coverage items:");
MGCAddSnippet(154, "You can filter data in the Tracker window in order to prune away aspects you do not need to see, or to focus on specific portions of the data. ");
MGCAddSnippet(155, "The default values match the semantics of the Contains filtering used in other tree-based windows and are recommended for regular use.");
MGCAddSnippet(156, "Use this dialog to include items in the filter list. In other words, selected items are filtered out.");
MGCAddSnippet(157, "Two commands can be used to retrieve the content of test attributes, depending on which of the simulation modes you are in: coverage atribute and vcover attribute.");
MGCAddSnippet(158, "Often ECOs (Engineering Change Orders) can occur late in the design cycle, when a design is highly stable. Only small sections of the design are affected by changes. You can use various Verification Management tools to analyze which tests most effectively cover those few areas and re-run those specific tests to demonstrate satisfactory coverage numbers. ");
MGCAddSnippet(159, "The Questa SIM Results Analysis functionality can be applied either within the Verification Run Manager (VRM) environment or in an independent scripting system. ");
MGCAddSnippet(160, "Two predominant use models for test triage are for analyzing and processing the results from multiple and checking individual simulations: regressions and individual simulations.");
MGCAddSnippet(161, "The generic use flow for the Results Analysis functionality is as described in this section.");
MGCAddSnippet(162, "The basic high level tasks for analyzing Results Analysis (triage) database information are :");
MGCAddSnippet(163, "Three types of files are accepted as inputs to the Results Analysis database (TDB): UCDB, WLF, and/or LOG.");
MGCAddSnippet(164, "Results Analysis helps to automate the process of reviewing test failures. ");
MGCAddSnippet(165, "With regards to data extraction, certain interesting and perhaps important information can be embedded within a message. This data might not be otherwise saved in pre-defined fields within the triage database. Transformation allows you to extract important data into user-defined fields for the purposes of sorting and analysis.");
MGCAddSnippet(166, "A rules file is a file that contains a collection of transforms. A transform is a Tcl construct that you write in order to parse and slice a message in a way to reveal only that information which is interesting and/or relevant to the analysis of your verification results. ");
MGCAddSnippet(167, "Several rules files containing transforms written for specific types of message transformation (OVM, UVM, and so on) have been provided for your use — as is, or as examples/templates you use to create your own rules files. ");
MGCAddSnippet(168, "Transform rules files can be created/edited within the GUI, through the Transform Rules File Editor dialog box.");
MGCAddSnippet(169, "Several triage command examples are contained in this section.");
MGCAddSnippet(170, "Several issues related to the Triage command are worthy of mention:");
MGCAddSnippet(171, "A lockfile is generated before any database writing or reading. Afterwards, the lockfile is automatically deleted. This prevents database corruption if multiple processes or threads want access to one triage database file. ");
MGCAddSnippet(172, "If you want to use some form of parallelism, via grids or other techniques, it is important not to delete or over-write previous database contents. Otherwise, the data produced might be non-deterministic. ");
MGCAddSnippet(173, "Search order is relevant to WLF or LOG files automatically imported as a result of having imported a UCDB file. In these cases, the following search order is observed:");
MGCAddSnippet(174, "The database (.tdb database or TDB) used for Results Analysis holds one or more sets of data, where each set corresponds to one unique test.  Each test you run in Questa SIM generates a set of data including two subsets of data: ");
MGCAddSnippet(175, "The testname field — one of the predefined fields in the UCDB and WLF databases — is critical to linking message and test record information. It associates the data with the UCDB and WLF. The value in the testname field must match between these two databases. If the data does not match, then the two data subsets will not be linked when viewing the triage database. ");
MGCAddSnippet(176, "Key to analyzing and interpreting data the displayed in the Results Analysis database (.tdb) is how the data is configured, sorted, queried. and filtered. ");
MGCAddSnippet(177, "One way to manipulate the data is through the configuration of the data hierarchy. Configurations can be managed from an open Results Analysis database, by choosing Results Analysis > Hierarchy Configurations.");
MGCAddSnippet(178, "Sorting the data offers you the ability to display results analysis data by user-defined fields in a UCDB, or by multiple columns in a Results Analaysis database (.tdb). ");
MGCAddSnippet(179, "The Analysis Questions combine the application of set filters, sorts, and/or hierarchical configurations for the purpose of getting answers some important questions concerning the data collected by tests which have been run. ");
MGCAddSnippet(180, "Filtering data prior to insertion into the triage database is necessary to prune away low-priority or irrelevant information: you may only want to know about tests which fail with fatal or error conditions. However, the triage database creation step allows you full flexibility to see all data. ");
MGCAddSnippet(181, "You can filter messages in an open database via the GUI using either the Results Analysis or Message Viewer window. ");
MGCAddSnippet(182, "Use the Editing Filter Expression dialog box to set expressions to be visible in the Results Analysis (or Message Viewer) window.");
MGCAddSnippet(183, "Once the database has been generated, the  triage report  CLI can print data in various formats and using various filters. The report can either print to the screen to output to a file. ");
MGCAddSnippet(184, "For example, you can create a default formatted text report of a Results Analysis database by entering a command such as:");
MGCAddSnippet(185, "Filtering is performed prior to insertion into the database via the  triage dbfile  command, however, additional filtering can be applied afterward via the  triage report  command to further narrow your search for important information. ");
MGCAddSnippet(186, "In order to provide a useful summary of messages in the report, data has been compressed, as indicated by  count . The count indicates how many same data items have been compressed for the display.");
MGCAddSnippet(187, "There are two sets of data — detailed and non-detailed — but three different report formats that can be used.");
MGCAddSnippet(188, "The Questa SIM vcover diff command creates a report of the component level differences between two UCDBs. ");
MGCAddSnippet(189, "Predefined fields exist for both the WLF and UCDB files. It is important not to override the values of these fields.");
MGCAddSnippet(190, "Two major sets of predefined fields exist: one set corresponds with WLF data, the other set with UCDB Test record data. ");
MGCAddSnippet(191, "This section contains a list of predefined fields from WLF files. ");
MGCAddSnippet(192, "Another set of predefined fields are UCDB fields. It is important to not use these predefined field names in triage transformations as they may conflict with this set of data. ");
MGCAddSnippet(193, "Any field specified in a rules file matching one of the predefined fields listed above is considered a user-defined field. ");
MGCAddSnippet(194, "In order to describe the transformation of message information from an ASCII logfile or WLF file, a rules file is required. ");
MGCAddSnippet(195, "This ASCII rules file contains the  transform  construct for message matching and a  field  construct for data extraction. The rules file supports the use of basic TCL commands and variables.");
MGCAddSnippet(196, "The following is a example of one complete rule within a rules file.");
MGCAddSnippet(197, "To accommodate logfiles that contains messages longer than a single line, include the newline character  \\n  in the regular expression in the transform construct. ");
MGCAddSnippet(198, "Related to the debugging of tranform rules, several issues should be understood:");
MGCAddSnippet(199, "If the transformation process does not yield the specific results you expect, there are several additional levels of debugging which provide visibility to your transforms through the triage dbfile command switches.");
MGCAddSnippet(200, "LOG file transforms are nearly identical to the WLF file transformations with one minor difference.");
MGCAddSnippet(201, "The transform buffer and the management of this buffer are explained in this section. ");
MGCAddSnippet(202, "Multi-line messages are represented in the rule by a newline ( \\n ) character in the regular expression. Regular expression rule matches are  anchored  at the start of the buffer. ");
MGCAddSnippet(203, "Once a match is either found or not, and the matching (or non-matching) line(s) are removed from the buffer, the algorithm proceeds to refill the buffer. ");
MGCAddSnippet(204, "Trends in the coverage achieved over a period of time can be identified and analyzed using a Verification Management s Trend Analysis functionality. Trend analysis offers you the ability to track the progress of the coverage over time of all the objects in your verification plan.");
MGCAddSnippet(205, "To analyze trends in your coverage, you run tests, create the necessary trend UCDB, and create a trend report. ");
MGCAddSnippet(206, "The trend UCDB represents a concise representation of trending data that can be archived for future reference. You can also merge together multiple trend UCDBs to create a new trend UCDB, essentially concatenating them. ");
MGCAddSnippet(207, "The use flow for trending can be summarized as follows.");
MGCAddSnippet(208, "The following is the complete set of objects to which trend analysis can apply:");
MGCAddSnippet(209, "Trend analysis figures are based on algorithms consistant with the Questa SIM when calculating coverage, as described in this section.");
MGCAddSnippet(210, "You can create a Trend database (a specially purposed UCDB) using the command line or the GUI. The input UCDBs need not be merged files; they can be individual files. They can also be trend UCDBs themselves.");
MGCAddSnippet(211, "You can add your own attributes to a Trend UCDB for the purpose of seeing that name/value expressed in the Trend report. ");
MGCAddSnippet(212, "You can create a report for viewing trends in coverage in HTML, XML. Text, or Comma Separated Value (CSV) files.");
MGCAddSnippet(213, "The Trend report data can be viewed in the Trender window in the Browser, after following a short sequence of steps.");
MGCAddSnippet(214, "The following frequently asked questions are offered in this section to assist you during the process of trending.");
MGCAddSnippet(215, "This appendix contains the file conventions, formatting and syntax details for the xml2ucdb.ini file. ");
MGCAddSnippet(216, "The xml2ucdb utility uses the configuration file to determine how to process the testplan being converted into a UCDB. ");
MGCAddSnippet(217, "An xml2ucdb.ini file is shipped with Questa SIM which is sufficient for configuring the vast majority of all testplan imports. Generally speaking, you should not need to modify this file to import a verification plan so long as the verification plan (a top level testplan) was created:");
MGCAddSnippet(218, "The xml2ucdb utility and Verification Plan Import Questa SIM uses to convert the XML file to UCDB format accepts XML version 1.0 files. For details on XML, see the  Extensible Markup Language (XML) 1.0 Specification,  available on the web.");
MGCAddSnippet(219, "The xml2ucdb.ini configuration file is where alternate settings can be specified which govern the conversion of a testplan from any supported testplan format to the UCDB format. ");
MGCAddSnippet(220, "Apart from the parameters discussed in the remainder of this appendix is the notion of parameterizing testplan values. You can override any parameter within a testplan with values specified by variables. ");
MGCAddSnippet(221, "Parameters are available to configure the importation of customized testplans. ");
MGCAddSnippet(222, "The parameters in this section relate to locating the XML files, their parameters, and/or interpreting the extraction parameters themselves.");
MGCAddSnippet(223, "The following parameters allow the extraction process to focus on a particular segment of the XML input and to exclude uninteresting XML data. ");
MGCAddSnippet(224, "These parameters allow us to divide the XML input into testplan sections and, within each section, into data items (or columns).");
MGCAddSnippet(225, "Data items extracted from the XML file can be assigned to specific columns or fields in the testplan. The  column/field  represents a predefined data classification, such as Weight, Goal, Section number, and so forth.");
MGCAddSnippet(226, "In some XML formats, certain data items are marked with explicit semantic tags. ");
MGCAddSnippet(227, "If either of the following two parameters are specified, the associated data value will be extracted from the named attribute matching the value of the given extraction parameter.");
MGCAddSnippet(228, "The parameter responsible for mapping testplan information to the generated UCDB by column sequence is the datafields parameter. The datafields parameter is used to extract data items which always appear in a known sequence in the input file — columns of a spreadsheet, for example. ");
MGCAddSnippet(229, "Labeled data items are used in the case where the division of data items is not consistent and/or the sequence of the data in each of the sections is not fixed -- as might be the case for a free-form word processor document. The parameter used for this type of mapping is datalabels. It can also be applied with the xml2ucdb command through the -datalabels argument. ");
MGCAddSnippet(230, "Certain rules apply related to case sensitivity, field mapping and attribute names.");
MGCAddSnippet(231, "There are two basic document styles supported by the XML import utility: auto-numbered and non auto-numbered.");
MGCAddSnippet(232, "In auto-number mode, the section numbers can be prefixed with strings to indicate the type of section found at each level of hierarchy. ");
MGCAddSnippet(233, "The  root  parameter defines the section number to be used for the root scope of the testplan. The  title  parameter defines the section name to be used for the root scope of the testplan.");
MGCAddSnippet(234, "In some cases, the incoming XML format is too complex for the simple tag-based extraction algorithm. This might include cases where the same tag is used for different purposes, depending on context to differentiate one from another, or when the same tag is used for multiple data items differentiated only by the value of an arbitrary attribute. ");

